import React from "react";
import Home from "./Pages/Home";
import { BrowserRouter as Routers, Route } from "react-router-dom";

function Routes() {
  return (
    <>

        <Routers>
          <Route path={'/home'} element={<Home />}  />

        </Routers>
    </>
  );
}

export default Routes;
